"use strict";
// Crie um array com 5 nomes de cidades. Use `for...of` para exibir no console:
function exibirCidades(cidades) {
    for (const cidade of cidades) {
        console.log(cidade);
    }
}
const cidades = ["Rafael Godeiro", "Patu", "Almino Afonso", "Mossoro", "Natal"];
exibirCidades(cidades);
